import React, { useEffect } from "react";

function PDFViewer({profile}) {
    useEffect(() => {
        console.log(profile)
    })
  return (
    <div>
      <div>
        <Document file={`./data/${profile}/${profile}.json`}>
            <Page width={800} />
        </Document>
      </div>
    </div>
  );
};

export default PDFViewer;
